/**
 * 种子杯网站首页
 * @file seed.js
 * @author 
 * @copyright 
 * @createDate 2020-12-15
 */

import React from 'react'
import { Link } from 'react-router-dom'
import seedlogo from "../../img/seedlogo.png"
import "../seed/seed.css"

class Seed extends React.Component{
    render() {
        return(
            <div className="main-banner">
                <Nav />
                <div className="containtent">
                    <button>
                        试题下载
                    </button>
                    <button>
                        提交结果
                    </button>
                </div>
                <img src={seedlogo} alt="seedlogo" className="seedlogo"/>
                <h1 style={{position: "relative"}}>This is Index Page!</h1>

                {this.props.children}
            </div>
        )
    }
};

class Nav extends React.Component{
    render() {
        return(
            <div>
                <nav style={{backgroundColor:"black"}} className="nav">
                    <ul>
                        <li style={{position: "relative", top: "20px", cursor: "pointer", float: "right"}}>
                            <Link to="/signin" style={{color:"white"}}>sign in</Link>
                        </li>
                        <li style={{position: "relative", top: "40px", right: "0"}}>
                            <Link to="/signup" style={{color:"white"}}>sign up</Link>
                        </li>
                    </ul>
                </nav>
            </div>
        )
    }
}

export default Seed;
